import styled from 'styled-components';

// eslint-disable-next-line import/prefer-default-export
export const Badge = styled.span`
  height: 19px;
  width: 19px;
  padding-bottom: 0.5px;
  display: inline-flex;
  align-items: center;
  justify-content: center;
  background: #f55152;
  color: #fff;
  line-height: 100%;
  border-radius: 5px;
  font-size: 15px;
  font-family: 'Product Sans', sans-serif;
  font-weight: 700;
  align-self: center;
  position: relative;
  top: -1px;
  height: 18.5px;
  cursor: pointer;
  user-select: none;
`;
